export function cargarConceptosGenerales(conceptos) {
  return {
    type: "CARGAR_CONCEPTOS_GENERALES",
    payload: conceptos,
  };
}

export function borrarConcepto(id) {
  return {
    type: "BORRAR_CONCEPTO_GENERAL",
    payload: id,
  };
}
